import React, { useState, useCallback } from "react";
import {useDispatch, useSelector} from "react-redux";
import { dataRequested } from "./model/effects";
import {searchResultSucces} from "./model/reducers";
import {searchSelect} from "./model/selectors";

const SearchWidget: React.FC = () => {
    const [username, setUsername] = useState("");
    const dispatch = useDispatch();
    const searchResult = useSelector(searchSelect.searchResult);

    const fetchData = useCallback(() => {
        if (username) {
            dataRequested({ username, dispatch });
        }
    }, [username, dispatch]);

    React.useEffect(() => {
        // @ts-ignore
        dispatch(searchResultSucces());
        fetchData();
    }, [fetchData]);

    return (
        <div className="profile-container">
            <>
            <input
                type="text"
                value={username}
                placeholder="Search by username"
                onChange={(e) => setUsername(e.target.value)}
            />
            {console.log(searchResult)}
            </>
        </div>
    );
};

export default SearchWidget;
